    false,nt"url": null,nt"notes": "Laser Mapping Specialist, Inc (LMSI) and
    The Atlantic Group (Atlantic) provided high accuracy, calibrated multiple return
    LiDAR for roughly 1,130 square miles around Norfolk, Virgina that either fully or
    partially cover the Virginia counties of Chesapeake, Hampton, James City, Newport
    News, Norfolk, Poquoson City, Portsmouth, Suffolk, Virginia Beach, Williamsburg,
    and York as well as the North Carolina counties of Camden and Currituck. The nominal
    point spacing for this project was no greater than 1 point every 0.7 meters. Dewberry
    used proprietary procedures to classify the LAS according to project specifications:
    1-Unclassified, 2-Ground, 7-Noise, 9-Water, 10-Ignored Ground, 11-Withheld Points.
    OCM reclassified class 11 points to Class 15 - (as needed: Witheld Points). Dewberry
    produced 3D breaklines and combined these with the final LiDAR data to produce seamless
    hydro flattened DEMs for the 1,458 (1500 m x 1500 m) UTM tiles and the 1,400 (5000
    ft x 5000ft) State Plane tiles that cover the project area.",nt"license_title":
